ads.description:
Sam sprowadziłem z Niemiec w listopadzie 2019, przebieg oryginalny, mam papiery, książkę serwisową. Od razu wymieniłem cały układ wydechowy, świece, filtry, płyny, opony (całoroczne Nokian). Jestem jedynym użytkownikiem, przejechałem 35000 km. Regularne serwisowanie w Q-Service przy Jugosłowiańskiej zgodnie z kartą technologiczną Toyoty (filtry i olej tylko japońskie). Przegląd i OC do 04.11.2025. 

Pozytyw: 

1. silnik, zawieszenie, cała mechanika w stanie idealnym;

2. elektryczne szyby i lusterka; 

3. tapicerka i obicia w stanie bardzo dobrym;

4. pełnowartościowe koło zapasowe;

5. od 11.2024 nowe chłodnica i akumulator. 

Negatyw: 

1. brak klimatyzacji;

2. wymaga prac blacharskich próg (prawy tył), zderzak lewy przód;

3. prawy bok jak i dach przy szybie czołowej były już przy kupnie takie jak na foto (mnie to nie przeszkadza, na jazdę nie wpływa);

4. od początku nie działa centralny zamek.

Witam, mam do sprzedania Alfę Romeo 159 SW 1.9 JTDm 16v 150 KM z 2006 roku. Jest to, moim zdaniem, optymalny wybór wśród 159-tek w dieslu, bo jest dynamiczniejsza niż 1.9 8v i nie tak droga w utrzymaniu jak 2.4. Sprzedaję, bo kupiłem młodsze auto i szkoda, żeby stała w garażu jako trzecie w rodzinie.
Alfa jest u mnie już 8 rok i przejechałem nią ok. 45 000 km. Przez ten czas Alfa była użytkowana i serwisowana regularnie. Co trzeba było, to robiłem na bieżąco. Jestem drugim właścicielem w kraju.
- po zakupie zrobiłem wszystko co należało, włącznie z wymianą rozrządu, remontem zawieszenia (kompletne przednie wahacze), wymienione tarcze hamulcowe z klockami i jeszcze jakieś pomniejsze rzeczy - mam na to faktury;
- co ważne, będąc już u mnie miała regenerowane turbo i maglownicę, na co mam dokumenty;
- w ostatnich latach regenerowany był alternator, wymieniłem akumulator, wymienione zostały amortyzatory i na jesieni zeszłego roku sprężyny (mam faktury);
- w zeszłym roku serwisowana była klimatyzacja - wymieniony oring czujki ciśnienia, opornica wentylatora (mam dokumenty). Wcześniej wymieniłem chłodnicę klimatyzacji, ale na nią nie mogę znaleźć faktury. Oczywiście po zeszłorocznym serwisie klima została nabita;
- ubezpieczenie OC do marca 2026 r.;
- przegląd techniczny zrobiony w dniu 12.03.2025 r., (stwierdzony został do wymiany jedynie przedni górny wahacz - został wymieniony 17.03, wymieniony przy okazji został olej silnikowy 5w30 Total z filtrem + filtr powietrza).
Alfa ma m.in. skórzaną tapicerkę, tempomat, el. szyby przód i tył, el. regulowane lusterka boczne, klimatyzację dwustrefową (kierowca, pasażer), dwa kluczyki (piloty), ładne alufelgi 17", lakier oceniam na stan dobry, choć są i mankamenty, jak to w 19 letnim samochodzie, auto było u mnie garażowane i przez okres użytkowania u mnie nie było w nim palone. Kolor auta zaznaczyłem jako czarny, ale jest to "nero oceano", jednakże bliżej jemu do czarnego, niż do granatowego.
W razie pytań proszę dzwonić lub pisać.
Cena do rozsądnej negocjacji dla zdecydowanego kupującego.
